import { css } from "@emotion/core";
import { Box, Container, Grid, Paper, Table, TableCell, TableRow, Typography } from "@material-ui/core";
import Skeleton from "@material-ui/lab/Skeleton";
import React from "react";

const container = css`
    width: 100%;
`;

const header = css`
    width: 100%;
    margin-bottom: 80px;
`;

const AppSkeleton = () => {
    const renderCell = () => (
        <TableCell>
            <Skeleton variant="rect" height={20} />
        </TableCell>
    );

    const renderRow = () => (
        <>
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
        </>
    );

    return (
        <div css={container}>
            <div css={header}>
                <Skeleton variant="rect" height={50} />
            </div>
            <Container maxWidth={"lg"}>
                <Box marginY={5}>
                    <Box marginBottom={2}>
                        <Grid container direction="row" justify="flex-end" alignItems="flex-end">
                            <Skeleton variant="rect" width={200} height={30} />
                        </Grid>
                    </Box>
                    <Box>
                        <Table component={Paper} elevation={2} variant="outlined">
                            <TableRow>{renderRow()}</TableRow>
                            {/* {renderRow()}

                            {renderRow()}
                            {renderRow()}
                            {renderRow()}
                            {renderRow()} */}
                        </Table>
                    </Box>
                    <Box marginTop={2}>
                        <Grid container direction="row" justify="flex-end" alignItems="baseline">
                            <Box marginRight={1}>
                                <Skeleton variant="rect" width={120} height={30} />
                            </Box>
                            <Skeleton variant="rect" width={120} height={30} />
                        </Grid>
                    </Box>
                </Box>
            </Container>
        </div>
    );
};

export default AppSkeleton;
